import React from 'react'
import Proptypes from 'prop-types'
import Task from './Task'

const Tasks = ({tasks}) => {

	return (
		<>
			{tasks.map((task)=>
				(<h3 key={task.id}>{task.text}</h3>
			))}
		</>
	)
}

export default Tasks
